PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE employees (
          id INTEGER PRIMARY KEY AUTOINCREMENT,
          no_emp INTEGER NOT NULL UNIQUE,
          nombre TEXT NOT NULL,
          search_text TEXT NOT NULL
        );
CREATE INDEX idx_no_emp ON employees(no_emp);
CREATE INDEX idx_nombre ON employees(nombre);
CREATE INDEX idx_search_text ON employees(search_text);
COMMIT;
